import{_ as l,a as d}from"./chunks/Contributors.vue_vue_type_script_setup_true_lang.3dcd3b9e.js";import{_ as c}from"./chunks/PageInfo.vue_vue_type_script_setup_true_lang.358bd1c3.js";import{_ as o,o as h,c as s,D as i,x as e,a,Q as _}from"./chunks/framework.c7127555.js";import"./chunks/commonjsHelpers.725317a4.js";const C=JSON.parse('{"title":"1. 状态码告知从服务器端返回的请求结果","description":"","frontmatter":{},"headers":[{"level":2,"title":"200 OK","slug":"_200-ok","link":"#_200-ok","children":[]},{"level":2,"title":"201 Created","slug":"_201-created","link":"#_201-created","children":[]},{"level":2,"title":"204 No Content","slug":"_204-no-content","link":"#_204-no-content","children":[]},{"level":2,"title":"206 Partial Content","slug":"_206-partial-content","link":"#_206-partial-content","children":[]},{"level":2,"title":"301 Moved Permanently","slug":"_301-moved-permanently","link":"#_301-moved-permanently","children":[]},{"level":2,"title":"302 Found","slug":"_302-found","link":"#_302-found","children":[]},{"level":2,"title":"303 See Other","slug":"_303-see-other","link":"#_303-see-other","children":[]},{"level":2,"title":"304 Not Modified","slug":"_304-not-modified","link":"#_304-not-modified","children":[]},{"level":2,"title":"307 Temporary Redirect","slug":"_307-temporary-redirect","link":"#_307-temporary-redirect","children":[]},{"level":2,"title":"400 Bad Request","slug":"_400-bad-request","link":"#_400-bad-request","children":[]},{"level":2,"title":"401 Unauthorized","slug":"_401-unauthorized","link":"#_401-unauthorized","children":[]},{"level":2,"title":"403 Forbidden","slug":"_403-forbidden","link":"#_403-forbidden","children":[]},{"level":2,"title":"404 Not Found","slug":"_404-not-found","link":"#_404-not-found","children":[]},{"level":2,"title":"500 Internal Server Error","slug":"_500-internal-server-error","link":"#_500-internal-server-error","children":[]},{"level":2,"title":"503 Service Unavailable","slug":"_503-service-unavailable","link":"#_503-service-unavailable","children":[]},{"level":2,"title":"Contributors","slug":"contributors","link":"#contributors","children":[]}],"relativePath":"basics/http/04状态码.md","lastUpdated":null}'),g={name:"basics/http/04状态码.md"},u=e("p",null,[a("@[toc] "),e("img",{src:"https://img-blog.csdnimg.cn/20210128160859158.png?x-oss-process=image/watermark,type_ZmFuZ3poZW5naGVpdGk,shadow_10,text_aHR0cHM6Ly9ibG9nLmNzZG4ubmV0L3dlaXhpbl80NDk3MjAwOA==,size_16,color_FFFFFF,t_70#pic_center",alt:"在这里插入图片描述"})],-1),m=e("h1",{id:"_1-状态码告知从服务器端返回的请求结果",tabindex:"-1"},[a("1. 状态码告知从服务器端返回的请求结果 "),e("a",{class:"header-anchor",href:"#_1-状态码告知从服务器端返回的请求结果","aria-hidden":"true"},"#")],-1),p=_('<blockquote><p>状态码的职责是当客户端向服务器端发送请求时，描述返回的请求结果</p></blockquote><ul><li>借助状态码，用户可以知道服务器端是正常处理了请求，还是出现了错误</li></ul><p><img src="https://img-blog.csdnimg.cn/img_convert/87869fb8698b4a7aa1e4f44a7afb5158.png" alt="image"></p><ul><li>数字中的第一位指定了响应类别，后两位无分类。</li><li>响应类别有以下5种</li></ul><p><img src="https://img-blog.csdnimg.cn/img_convert/503f3176c052dd3c9249322ec2f6d9ec.png" alt="image"></p><h1 id="_2xx成功" tabindex="-1">2XX成功 <a class="header-anchor" href="#_2xx成功" aria-hidden="true">#</a></h1><blockquote><p>2XX的响应结果表明请求被正常处理了</p></blockquote><h2 id="_200-ok" tabindex="-1">200 OK <a class="header-anchor" href="#_200-ok" aria-hidden="true">#</a></h2><ul><li>表示从客户端发来的请求在服务器端被正常处理了</li><li>在响应报文内，随状态码一起返回的信息会因方法的不同而发生改变 <img src="https://img-blog.csdnimg.cn/img_convert/04c6f327bf032406e7fd560281a3e96d.png" alt="image"></li></ul><h2 id="_201-created" tabindex="-1">201 Created <a class="header-anchor" href="#_201-created" aria-hidden="true">#</a></h2><p>已创建，成功请求并创建了新的资源</p><h2 id="_204-no-content" tabindex="-1">204 No Content <a class="header-anchor" href="#_204-no-content" aria-hidden="true">#</a></h2><ul><li>该状态码代表服务器接收的请求已成功处理，但在返回的响应报文中不含实体的主体部分 <img src="https://img-blog.csdnimg.cn/img_convert/0e57e9225e2be4374c4848f1d2bacc29.png" alt="image"></li></ul><h2 id="_206-partial-content" tabindex="-1">206 Partial Content <a class="header-anchor" href="#_206-partial-content" aria-hidden="true">#</a></h2><ul><li>该状态码表示客户端进行了范围请求，而服务器成功执行了这部分的GET请求</li><li>响应报文中包含由Content-Range指定范围的实体内容 <img src="https://img-blog.csdnimg.cn/img_convert/c54f81093ef67658887686f5e7ba2237.png" alt="image"></li></ul><h1 id="_3xx重定向" tabindex="-1">3XX重定向 <a class="header-anchor" href="#_3xx重定向" aria-hidden="true">#</a></h1><p>3XX响应结果表明浏览器需要执行某些特殊的处理以正确处理请求</p><h2 id="_301-moved-permanently" tabindex="-1">301 Moved Permanently <a class="header-anchor" href="#_301-moved-permanently" aria-hidden="true">#</a></h2><blockquote><p>永久性重定向</p></blockquote><p>该状态码表示请求的资源已被分配了新的URI，以后应使用资源现在所指的URI <img src="https://img-blog.csdnimg.cn/img_convert/8d45c691a758fb6d2a6de91d46831f9a.png" alt="image"></p><h2 id="_302-found" tabindex="-1">302 Found <a class="header-anchor" href="#_302-found" aria-hidden="true">#</a></h2><blockquote><p>临时性重定向</p></blockquote><p>该状态码表示请求的资源已被分配了新的URI，希望用户（本次）能使用新的URI访问 <img src="https://img-blog.csdnimg.cn/img_convert/564fdd46900d9ecf5e31694f64376d5b.png" alt="image"></p><h2 id="_303-see-other" tabindex="-1">303 See Other <a class="header-anchor" href="#_303-see-other" aria-hidden="true">#</a></h2><p>该状态码表示由于请求对应的资源存在着另一个URI，应使用GET方法定向获取请求的资源</p><p><img src="https://img-blog.csdnimg.cn/img_convert/845a27d0aa04cf7792a38df487b3da88.png" alt="image"></p><h2 id="_304-not-modified" tabindex="-1">304 Not Modified <a class="header-anchor" href="#_304-not-modified" aria-hidden="true">#</a></h2><ul><li>该状态码表示客户端发送附带条件的请求时，服务器端允许请求访问资源，但因发生请求未满足条件的情况后，直接返回304 Not Modified（服务器端资源未改变，可直接使用客户端未过期的缓存）</li><li>304状态码返回时，不包含任何响应的主体部分</li><li>304虽然被划分在3XX类别中，但是和重定向没有关系</li></ul><p><img src="https://img-blog.csdnimg.cn/img_convert/c381d284afce30dc3485ac840ee33fd0.png" alt="image"></p><h2 id="_307-temporary-redirect" tabindex="-1">307 Temporary Redirect <a class="header-anchor" href="#_307-temporary-redirect" aria-hidden="true">#</a></h2><blockquote><p>临时重定向</p></blockquote><ul><li>该状态码与302 Found有着相同的含义</li><li>尽管302标准禁止POST变换成GET，但实际使用时大家并不遵守</li><li>307会遵照浏览器标准，不会从POST变成GET. 但是，对于处理响应时的行为，每种浏览器有可能出现不同的情况</li></ul><h1 id="_4xx客户端错误" tabindex="-1">4XX客户端错误 <a class="header-anchor" href="#_4xx客户端错误" aria-hidden="true">#</a></h1><blockquote><p>4XX的响应结果表明客户端是发生错误的原因所在</p></blockquote><h2 id="_400-bad-request" tabindex="-1">400 Bad Request <a class="header-anchor" href="#_400-bad-request" aria-hidden="true">#</a></h2><ul><li>该状态码表示请求报文中存在语法错误</li><li>当错误发生时，需修改请求的内容后再次发送请求</li><li>浏览器会像200 OK一样对待该状态码</li></ul><p><img src="https://img-blog.csdnimg.cn/img_convert/4296d130b88f607cab5ec7b9a26d58a5.png" alt="image"></p><h2 id="_401-unauthorized" tabindex="-1">401 Unauthorized <a class="header-anchor" href="#_401-unauthorized" aria-hidden="true">#</a></h2><ul><li>该状态码表示发送的请求需要有通过HTTP认证（BASIC认证、DIGEST认证）的认证信息</li><li>另外若之前已进行过1次请求，则表示用户认证失败</li></ul><p><img src="https://img-blog.csdnimg.cn/img_convert/79151ce7d72902c9bbe425ba75ad8723.png" alt="image"></p><h2 id="_403-forbidden" tabindex="-1">403 Forbidden <a class="header-anchor" href="#_403-forbidden" aria-hidden="true">#</a></h2><ul><li>该状态码表明对请求资源的访问被服务器拒绝了</li></ul><p><img src="https://img-blog.csdnimg.cn/img_convert/1a7c04633e1ea7c47cecb85fc92891b9.png" alt="image"></p><h2 id="_404-not-found" tabindex="-1">404 Not Found <a class="header-anchor" href="#_404-not-found" aria-hidden="true">#</a></h2><ul><li>该状态码表明服务器上无法找到请求的资源</li><li>除此之外，也可以在服务器端拒绝请求且不想说明理由时使用</li></ul><p><img src="https://img-blog.csdnimg.cn/img_convert/585bc00bf9ef8e588dfc6d1db47e613a.png" alt="image"></p><h1 id="_5xx服务器错误" tabindex="-1">5XX服务器错误 <a class="header-anchor" href="#_5xx服务器错误" aria-hidden="true">#</a></h1><blockquote><p>5XX的响应结果表明服务器本身发生错误</p></blockquote><h2 id="_500-internal-server-error" tabindex="-1">500 Internal Server Error <a class="header-anchor" href="#_500-internal-server-error" aria-hidden="true">#</a></h2><ul><li>该状态码表明服务器端在执行请求时发生了错误</li><li>也有可能是Web应用存在的bug或某些临时的故障</li></ul><p><img src="https://img-blog.csdnimg.cn/img_convert/58d92e05874d8abf66bc006c3cef6dc5.png" alt="image"></p><h2 id="_503-service-unavailable" tabindex="-1">503 Service Unavailable <a class="header-anchor" href="#_503-service-unavailable" aria-hidden="true">#</a></h2><ul><li>该状态码表明服务器暂时处于超负载或正在进行停机维护，现在无法处理请求 <img src="https://img-blog.csdnimg.cn/img_convert/b7c52a3b4691ad8401df7d0dda8868e5.png" alt="image"></li></ul><h2 id="contributors" tabindex="-1">Contributors <a class="header-anchor" href="#contributors" aria-hidden="true">#</a></h2>',54);function b(f,v,x,k,q,T){const t=c,r=l,n=d;return h(),s("div",null,[u,m,i(t,{readTime:"3",words:"1.1k"}),p,i(r),i(n)])}const F=o(g,[["render",b]]);export{C as __pageData,F as default};
